import React from "react";
import Form from "./Form";
import Plan from "./Plan";

class Main extends React.Component
{
    constructor(props) {
        super(props);
    }

    render() {
        return (<div className="main">
           <Form />
           <Plan />
        </div>);
    }
}

export default Main;
